import React from 'react';

class FileUpload extends React.Component {
    constructor() {
        super();
    }

    render() {
        const hideGrid = {
            background:'transparent',
            borderColor:'transparent'
        };

        return (
            <div className="show-grid" style={{paddingTop:20}}>
                <div className="row">
                    <div className="columns large-5" style={hideGrid}>
                        <p>Upload Students information from an excel file (.XLS or .XLSX). Files
                        must adhere to the format shown to the right.</p>
                    </div>
                </div>
            </div>
        );
    }
}

export default FileUpload;
